import HomePage from './pages/homepage/homepage.component'
import './App.css';
import {Route} from 'react-router-dom'


const HatsPage =() => (
  <div>
    <h1>HatsPage</h1>
  </div>
)


function App() {
  return (
    <div >
      <Route  path="/" component={HomePage}/>
      <Route ex path="/hats" component={HatsPage}/>
    </div>
  );
}

export default App;
